import React from 'react'

function UsersDisplay(props) {
    const {users} = props
  return (
    <>
     <div className="wrap">
        {users?.map((user, index)=> (
            <div  className="box" >
                <div className="innerBox">
                    <img src={user.profile_image.large} alt=""/>
                    <h2>{user.name}</h2>
                </div>     
            </div>
        ))} 
    </div>
    </>
  )
}

export default UsersDisplay
